import React from 'react';
import IdComponent from './components/IdComponent';
import NameComponent from './components/NameComponent';
import SizeComponent from './components/SizeComponent';
import PriceComponent from './components/PriceComponent';
import ImagesComponent from './components/ImagesComponent';
import './styles/App.css';

const App = () => {
    const watches = [
        {
            id: '12345',
            name: 'Stylish Watch',
            size: '42mm',
            price: '$199.99',
            images: [
                'image1.jpg',
                'image2.jpg',
                'image3.jpg'
            ]
        },
        {
            id: '67890',
            name: 'Classic Watch',
            size: '38mm',
            price: '$149.99',
            images: [
                'image4.jpg',
                'image5.jpg',
                'image6.jpg'
            ]
        }
        // Thêm các đồng hồ khác nếu cần
    ];

    return (
        <div className="container">
            <h1>Watch Details</h1>
            <div className="grid-container">
                {watches.map((watch, index) => (
                    <div key={index} className="grid-item">
                        <IdComponent id={watch.id} />
                        <NameComponent name={watch.name} />
                        <SizeComponent size={watch.size} />
                        <PriceComponent price={watch.price} />
                        <ImagesComponent images={watch.images} />
                    </div>
                ))}
            </div>
        </div>
    );
};

export default App;
